# 214. 最短回文串.py


# 超时
class Solution:
    def shortestPalindrome(self, s: str) -> str:
        if not s:
            return ""

        def is_palindrome(l, r):
            while l < r:
                if s[l] != s[r]:
                    return False
                l += 1
                r -= 1
            return True

        n = len(s)
        for i in range(n - 1, -1, -1):
            if is_palindrome(0, i):
                return s[i + 1:][::-1] + s


class Solution:
    def shortestPalindrome(self, s: str) -> str:
        if not s:
            return ""

        def is_palindrome(s):
            return s[::-1] == s

        n = len(s)
        for i in range(n, 0, -1):
            if is_palindrome(s[:i]):
                return s[i:][::-1] + s


class Solution:
    def shortestPalindrome(self, s: str) -> str:
        def get_table(p):
            table = [0] * len(p)
            i = 1
            j = 0
            while i < len(p):
                if p[i] == p[j]:
                    j += 1
                    table[i] = j
                    i += 1
                else:
                    if j > 0:
                        j = table[j - 1]
                    else:
                        i += 1
                        j = 0
            return table

        table = get_table(s + "#" + s[::-1])
        return s[table[-1]:][::-1] + s


class Solution:
    def shortestPalindrome(self, s: str) -> str:
        if not s:
            return s

        def get_lps(p, m):
            lps = [-1] * m
            k = -1
            for i in range(1, m):
                while k != -1 and p[i] != p[k + 1]:
                    k = lps[k]
                if p[i] == p[k + 1]:
                    k += 1
                lps[i] = k
            return lps

        ns = s + '#' + s[::-1]
        lps = get_lps(ns, len(ns))
        return s[lps[-1] + 1:][::-1] + s


def main():
    sol = Solution()
    s = "abcd"
    res = sol.shortestPalindrome(s)
    print(res)

    s = "aabba"
    res = sol.shortestPalindrome(s)
    print(res)

    s = ""
    res = sol.shortestPalindrome(s)
    print(res)

    s = ""
    res = sol.shortestPalindrome(s)
    print(res)


if __name__ == '__main__':
    main()
